import notes from "../notes";
import Note from "./Note";
import Header from "./Header";
import Footer from "./Footer";

function createCard(notes){
    return (
        <Note 
        key={notes.id}
        title={notes.title}
        content={notes.content}
        />
    );
}

function App(){
    return (
        <div>
        <Header />
        {notes.map(createCard)}
        <Footer />
        </div>
        )
}
export default App;
